def load_inputs(input_file):
    """Load input values from the input Excel template."""
    cells = {}
    
    # Start with defaults
    cells.update(DEFAULT_INPUTS)
    cells.update(LABELS)
    
    # Override with values from input file
    if os.path.exists(input_file):
        wb = openpyxl.load_workbook(input_file, data_only=True)
        for sheet_name in wb.sheetnames:
            ws = wb[sheet_name]
            for row in ws.iter_rows():
                for cell in row:
                    if cell.value is not None:
                        cells[(sheet_name, cell.row, cell.column)] = cell.value
        wb.close()
    else:
        print(f"Warning: Input file {input_file} not found. Using default values.")
    
    return cells


