def write_output(cells, output_file):
    """Write calculated results to an Excel file with formatting."""
    wb = openpyxl.Workbook()
    wb.remove(wb.active)
    
    for sheet_name in SHEET_NAMES:
        ws = wb.create_sheet(title=sheet_name)
        
        # Get sheet dimensions
        if sheet_name in SHEET_DIMENSIONS:
            min_r, min_c, max_r, max_c = SHEET_DIMENSIONS[sheet_name]
        else:
            continue
        
        # Write all cell values
        for r in range(min_r, max_r + 1):
            for c in range(min_c, max_c + 1):
                key = (sheet_name, r, c)
                if key in cells and cells[key] is not None:
                    cell = ws.cell(row=r, column=c, value=cells[key])
                    
                    # Apply number format
                    if key in NUMBER_FORMATS:
                        cell.number_format = NUMBER_FORMATS[key]
                    
                    # Apply font style
                    if key in FONT_STYLES:
                        bold, color_rgb, size, name = FONT_STYLES[key]
                        font_kwargs = {}
                        if bold:
                            font_kwargs['bold'] = True
                        if color_rgb:
                            # Ensure 8-char aRGB format
                            c = color_rgb.lstrip('#')
                            if len(c) == 6: c = 'FF' + c
                            if len(c) == 8:
                                font_kwargs['color'] = c
                        if size:
                            font_kwargs['size'] = size
                        if name:
                            font_kwargs['name'] = name
                        if font_kwargs:
                            try:
                                cell.font = Font(**font_kwargs)
                            except Exception:
                                pass
                    
                    # Apply fill
                    if key in FILL_COLORS:
                        fill_rgb = FILL_COLORS[key]
                        if fill_rgb:
                            fc = fill_rgb.lstrip('#')
                            if len(fc) == 6: fc = 'FF' + fc
                            if len(fc) == 8:
                                try:
                                    cell.fill = PatternFill(start_color=fc, end_color=fc, fill_type='solid')
                                except Exception:
                                    pass
                    
                    # Apply alignment
                    if key in ALIGNMENTS:
                        h, v, wrap = ALIGNMENTS[key]
                        cell.alignment = Alignment(horizontal=h, vertical=v, wrap_text=wrap)
        
        # Apply column widths
        if sheet_name in COLUMN_WIDTHS:
            for col_letter, width in COLUMN_WIDTHS[sheet_name].items():
                ws.column_dimensions[col_letter].width = width
        
        # Apply row heights
        if sheet_name in ROW_HEIGHTS:
            for row_num, height in ROW_HEIGHTS[sheet_name].items():
                ws.row_dimensions[row_num].height = height
        
        # Apply merged cells
        if sheet_name in MERGED_CELLS:
            for mc in MERGED_CELLS[sheet_name]:
                try:
                    ws.merge_cells(mc)
                except Exception:
                    pass
    
    wb.save(output_file)
    print(f"Output saved to: {output_file}")


def main():
    """Main entry point."""
    input_file = sys.argv[1] if len(sys.argv) > 1 else "input_template.xlsx"
    output_file = sys.argv[2] if len(sys.argv) > 2 else "output.xlsx"
    
    print(f"Loading inputs from: {input_file}")
    cells = load_inputs(input_file)
    print(f"Loaded {len(cells)} input values")
    
    print("Calculating...")
    cells = calculate(cells)
    print(f"Calculated {len(cells)} cell values")
    
    print(f"Writing output to: {output_file}")
    write_output(cells, output_file)
    print("Done!")


if __name__ == "__main__":
    main()